import { 
    GET_LASTEST_RELEASE_FAIL, 
    GET_LASTEST_RELEASE_SUCCESS, 
    SEARCH_KEYWORD_CHANGE,
} from "../../action/homeTab/homeTab.action";

const initialState = {
    lastestReleaseItems: [
        {
            novel_name: 'Bringing The Farm To Live In Another World',
            novel_picture: 'data:image/jpeg;base64,',
            chap_title: 'Chapter 1771 - Ongoing',
            uploaded_time: '1 phút trước'
        },
        {
            novel_name: 'Bringing The Farm To Live In Another World',
            novel_picture: 'data:image/jpeg;base64,',
            chap_title: 'Chapter 1771 - Ongoing',
            uploaded_time: '1 phút trước'
        },
        {
            novel_name: 'Bringing The Farm To Live In Another World',
            novel_picture: 'data:image/jpeg;base64,',
            chap_title: 'Chapter 1771 - Ongoing',
            uploaded_time: '1 phút trước'
        }
    ],

    keyword: ''
};

export default function homeTabReducer(state = initialState, action) {
    switch (action.type) {
        case SEARCH_KEYWORD_CHANGE:
            return {
                ...state,
                keyword: action.value
            }
        case GET_LASTEST_RELEASE_SUCCESS:
            return {
                ...state,
                lastestReleaseItems: action.value
            }
        case GET_LASTEST_RELEASE_FAIL:
            return {
                ...state,
                lastestReleaseItems: []
            }

        default:
            return {
                ...state
            }
    }
}